import React , { useState , useEffect} from 'react'
import './index.css'

const url = 'https://api.dotpe.in/api/catalog/store/1/menu?mDomain=fryerstory.in&saletype=delivery&serviceSubtype=delivery';

export const App = () => {
    const [api_data , setapi_data] = useState([]);

    const getdishes = async () =>
    {
      const response = await fetch(url);
      const api_data = await response.json();
      console.log(api_data);
      setapi_data(api_data);
    }

    useEffect(() => {
      getdishes();
    } , []);

    return(
      <>
        <h2>menu items</h2>
        <ul>
          {api_data.menuItems.map((iterator) => {
            return(
              <li>
                <span>{iterator.itemAdditionalInfo.itemName}</span>
              </li>
            );
          })}
        </ul>
      </>
    );
  }

export default App
